import mongoose from 'mongoose';

mongoose.connect('mongodb+srv://test-user:9502142q24jb8nA@cabins-oytl7.mongodb.net/test?retryWrites=true&w=majority', {
    useNewUrlParser: true
}, function(error){
    if(error){
        console.log(`error occured ${error}`);
    } else {
        console.log('Mongoose is connected')
    }
});
